import * as React from "react"
import './main.css';

const Redesign = () => {
    return (
        <div>
            <h1>Responsive Redesign</h1>
                <h2>Introduction</h2>
                {/* <img id="screenshot" src=screenshot.png alt="screenshot of website to be redesigned" /> */}
                This is a project for CS1300: User Interface and Experience at Brown University, in which I redesign 
                an existing webpage based on usability standards. I will analyze and identify flaws in an existing interface, 
                create low-fidelity and high-fidelity prototypes for various screen sizes, and build a responsive website based 
                on those prototypes.

                I have chosen to redesign the home page of a local Rhode Island soap business: <a href="http://seafoamtradingco.com/">Newport Sea Foam Trading Co.</a> 
                A screen shot of the homeage is shown.

            <h2>Identifying Problems</h2>
            I analyzed the usability of the website using the criteria we learned about in class: usability, learnability, and memorabilty. My findings are shown here:




        </div>
    );
}

export default Redesign;
